INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (2, 0, 1, 15, 0, 0, 24001, 30000, "", "", 35);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 0, 100, 1, 0, 0, 91002, 40000, "", "", 36);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107501, 150, 1, 0, 1, 91002, 40001, "ぺコリーヌ", "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 37);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107601, 150, 2, 0, 1, 91002, 40001, "コッコロ", "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 38);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107801, 150, 3, 0, 1, 91002, 40001, "キャル", "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 39);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107701, 150, 4, 0, 1, 91002, 40001, "スズメ", "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 40);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107901, 150, 5, 0, 1, 91002, 40001, "タマキ", "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 41);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107501, 150, 6, 0, 2, 91002, 40001, "ぺコリーヌ", "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 42);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107601, 150, 7, 0, 2, 91002, 40001, "コッコロ", "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 43);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107801, 150, 8, 0, 2, 91002, 40001, "キャル", "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 44);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107701, 150, 9, 0, 2, 91002, 40001, "スズメ", "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 45);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 107901, 150, 10, 0, 2, 91002, 40001, "タマキ", "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 46);
INSERT INTO `v1_55e10b64bee859a801df1d361aefa81d45dd82d0572d3e68dfd3a6ebada0d3c6` VALUES (8, 0, 150, 1, 0, 0, 91002, 40003, "", "", 57);
